Bonjour&nbsp;Titoune45480,&nbsp;

Nous nous réjouissons que cet échange téléphonique avec notre collaborateur.rice ait pu vous apporter satisfaction.&nbsp;

Nous mettons tout en œuvre afin de garantir un traitement des demandes dans les meilleurs délais.&nbsp;Lorsqu'un délai supplémentaire est nécessaire, nous en informons nos assurés.

Madame, Monsieur,

Merci d’avoir partagé votre expérience avec la DGFiP sur "Services Publics +".&nbsp;

Nous avons bien pris connaissance de votre témoignage et nous vous en remercions.

La Trésorerie amendes de Paris 2ème Division connaît actuellement un surcroît d'activité qui entraîne un nombre important&nbsp; d'appels téléphoniques.&nbsp;
&nbsp;
Nous mettons actuellement tout en oeuvre pour remédier à cette situation et vous apporter une réponse précise dans les meilleurs délais.

Afin de vous permettre d'obtenir des précisions sur votre dossier,&nbsp; je vous invite à renouveler votre demande par l'envoi d'un courriel à :

t075062@dgfip.finances.gouv.fr

==&gt; Il est indispensable d'y préciser : votre nom, prénom, date de naissance, adresse à jour, numéro de téléphone, copie du document reçu ou en lien avec la Trésorerie Paris amendes 2e division et une photocopie de votre pièce d'identité. En l'absence des informations demandées, votre demande ne pourra pas être traitée.

Enfin, l'accueil physique de la Trésorerie de Paris Amendes 2e division 15 rue Maryse Hilsz 75020 Paris est ouvert sans rendez-vous du lundi au vendredi de 8h45 à 12h45.
